import React, { useEffect, useState, createElement } from "react";

import Axios from "axios";
import misthoLogo from "./assets/img/mistho-logo.svg";

import "./App.css";

const App = () => {
  const [elements, setElements] = useState([]);

  useEffect(() => {
    Axios.post(`${process.env.REACT_APP_SERVER_URL}/fetch-and-scrape`)
      .then((response) => {
        setElements(response.data.html);
      })
      .catch((error) => console.log(error));
    return () => {};
  }, []);

  return (
    <div className="App">
      {elements.map(function (name, index) {
        return createElement(
          elements[index][0].tag,
          {
            className:
              elements[index][0].class !== undefined
                ? elements[index][0].class
                : null,
            src:
              elements[index][0].tag === "img" ? elements[index][0].img : null,
            dangerouslySetInnerHTML: elements[index][0].text,
          },
          elements[index][0].tag === "input" ||
            elements[index][0].tag === "img" ||
            elements[index][0].tag === "hr"
            ? null
            : elements[index][0].text !== undefined
            ? elements[index][0].text
            : ""
        );
      })}
    </div>
  );
};

export default App;
